import {apiCall} from '../utils/apiCall'
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Rodal from 'rodal';
import 'rodal/lib/rodal.css'

function Home() {
    const navigate = useNavigate();
    const [queues, setQueues] = useState([]);
    const [visible, setVisible] = useState(false);
    const [visible2, setVisible2] = useState(false);
    const [save, setSave] = useState({});

    useEffect(()=>{
        getInProgressQueues();
    }, [])

    function getInProgressQueues(){
        apiCall('/queue/in-progress', 'get').then(res=>{
            setQueues(res.data)
        })
    }

    function toggle(){
        setVisible(prev=>!prev)
    }
    
    function toggle2(){
        setVisible2(prev=>!prev)
    }

    function addQueue(e){
        e.preventDefault();
        let data = {name: e.target[0].value};
        apiCall('/queue', 'post', data).then(res=>{
            setSave(res.data);
            toggle();
            toggle2();
        });
    }

    return (
        <div>
            <h1>Home page</h1>
            <button className='btn btn-info mx-2' onClick={toggle}>Register now</button>
            <button className='btn btn-info mx-2' onClick={()=>navigate('/login')}>Login now</button>
            <table className='table'>
                <thead>
                    <tr>
                        <td>t/r</td>
                        <td>name</td>
                        <td>Queue Number</td>
                        <td>Queue Status</td>
                        <td>operator name</td>
                    </tr>
                </thead>
                <tbody>
                    {
                        queues.map(queue=> <tr>
                            <td>{queue.id}</td>
                            <td>{queue.name}</td>
                            <td>{queue.queueNumber}</td>
                            <td>{queue.queueStatus}</td>
                            <td>{queue.operator.fullName}</td>
                        </tr>)
                    }
                </tbody>
            </table>

            <Rodal visible={visible} onClose={toggle}>
                <div className="card">
                    <div className="card-header">
                        <h5>new Queue</h5>
                    </div>
                    <form onSubmit={addQueue} action="">
                        <div className="card-body">
                            <input type="text" className='form-control my-2' />
                        </div>
                        <div className="card-footer">
                            <button className="btn btn-warning w-100">Submit</button>
                        </div>
                    </form>
                </div>
            </Rodal>

            <Rodal visible={visible2} onClose={toggle2}>
                <div className="card">
                    <div className="card-header">
                        <h5>{save.queueNumber}</h5>
                    </div>
                    <div className="card-body">
                        <div>Waitish: {save.name}</div>
                        <div>Queue status: {save.queueStatus}</div>
                    </div>
                    <div className="card-footer">
                        <button className='btn btn-danger mx-2'>print</button>
                        <button onClick={toggle2} className='btn btn-success mx-2'>ok</button>
                    </div>
                </div>
            </Rodal>
        </div>
    )
}

export default Home;
